	filterShops() {
		jQuery('.wdx-shops-sidebar-filter-item').on('click', function() {
			jQuery('.wdx-shops-sidebar-filter-item').removeClass('active');
			var item, type, sidebarItem, sidebarType;
			item = jQuery(this);
			item.addClass('active');
			type = item.data('type');
			switch(type) {
				case 'all':
					jQuery('.wdx-shops-sidebar-item, .wdx-map-marker').addClass('active');
				break;
				case 'list':
					jQuery('.wdx-shops-list-container').addClass('active');
					jQuery('.wdx-shops-sidebar').removeClass('active');
					jQuery('.wdx-shops-sidebar-item, .wdx-map-marker').addClass('active');
				break;
				default:
					jQuery('.wdx-shops-sidebar-item, .wdx-map-marker').removeClass('active');
					jQuery('.wdx-shops-sidebar-type-'+type+', .wdx-map-marker-'+type).addClass('active');
				break;
			}
		});
	}

	buildMap() {

		let map, marker, location, lon, lat, data, data2 = [], api = new API();
		const reducer = (accumulator, currentValue) => parseInt(accumulator) + parseInt(currentValue);

		location = this.location;
		lon = location.lon;
		lat = location.lat;
		data = JSON.parse(this.shopsData);

		// Mapbox token
		mapboxgl.accessToken = 'pk.eyJ1Ijoid2VlZGV4cHJlc3MiLCJhIjoiY2l2c2U2ZmVjMDRrdDJ0bXU4OTRmaTh0MCJ9.M0V8zr_NfjTRztXPGiC1ag';

		// Mapbox Object
		map = new mapboxgl.Map({
		    container: 'map', // container id
		    style: 'mapbox://styles/mapbox/streets-v9', // stylesheet location
		    center: [lon, lat], // starting position [lng, lat]
		    maxZoom: 17,
		    minZoom: 3,
		    zoom: 5 // starting zoom
		});

		// Create DOM element for the marker
	    marker = document.createElement('div');
	    marker.id = 'wdx-current-marker';
	    marker.innerHTML = '<div></div><div></div><div></div>';

	    // Create the marker
	    new mapboxgl.Marker(marker, {offset:[-7.5,-7.5]})
	        .setLngLat([lon, lat])
	        .addTo(map);

	    // Mapbox on load fly to
		map.on('load', function() {
			map.flyTo({
		        center: [lon, lat],
		        zoom: 12
		    });

		    for (var i = 0; i < data.length; i++) {
		        // create DOM element for the marker
		        let shopMarker, geometry, coordinates, distance, reviews = 0, reviewsCount;

		        shopMarker = document.createElement('div');
		        shopMarker.className = 'marker wdx-map-marker wdx-map-marker-'+data[i].properties.type.toLowerCase();
		        coordinates = data[i].geometry.coordinates;
		        distance = api.distance([lon,coordinates[0],lat,coordinates[1]]);
		        reviewsCount = data[i].properties.reviews.length;
		        if(reviewsCount) { reviews = data[i].properties.reviews.reduce(reducer) / reviewsCount }
		        data[i].properties.distance = distance;
		        data[i].properties.reviews_avg = reviews.toFixed(1);
		        data[i].properties.reviews_count = reviewsCount;
		        // shopMarker.style.backgroundImage = 'url('+data[i].properties.image+')';

		        // checkZoom(shopMarker, zoom);

		        // create the marker
		        new mapboxgl.Marker(shopMarker)
		            .setLngLat([data[i].geometry.coordinates[0], data[i].geometry.coordinates[1]])
		            .addTo(map);

		        // , {offset:[-10,-10]}
		    }

		    // Add our vector tile source: World wide
		    // shops provided by Natural Earth
		    map.addSource('shops', {
		        type: 'geojson',
		        data: {
		            "type": "FeatureCollection",
		            "features": data
		       }
		    });

		    map.addLayer({
		        'id': 'shop',
		        'type': 'circle',
		        'source': 'shops',
		        'paint': {
		            // make circles larger as the user zooms from z12 to z22
		            'circle-radius': {
		                'base': 0,
		                'stops': [[12, 0], [22, 0]]
		            },
		            // color circles by ethnicity, using data-driven styles
		            'circle-color': {
		                property: 'type',
		                type: 'categorical',
		                stops: [
		                    ['Doctor', '#3498db'],
		                    ['Dispensary', '#51af3e'],
		                    ['Delivery', '#e74c3c'],
		                    ['Other', '#f1c40f']]
		            }
		        }
		    });

		});

		map.on('moveend', function() {

	        let features = map.queryRenderedFeatures({layers:['shop']});
	        let shops = new Shops();
	        let uniqueFeatures;
	        if (features) {

	            uniqueFeatures = shops.getUniqueFeatures(features, "uniqueId");
	            // Populate features for the listing overlay.
	            
	            shops.buildSidebar(uniqueFeatures,location);
	            shops.buildList(uniqueFeatures,location);

	            // Store the current features in shops variable to later use for filtering on keyup.
	            // shops = uniqueFeatures;

	        }
	        else {
	        	console.log('nothing to display...');
	        }
	    });

	}

