	listBars() {

		jQuery('.wdx-shops-list-container').scroll(function() {
			var pos;
			pos = jQuery('.wdx-shops-list-container').scrollTop();
			if(pos > jQuery('.wdx-shops-list-banner').height()) {
				jQuery('.wdx-shops-list-sidebar, .wdx-shops-list-toolbar').addClass('active');
			}
			else {
				jQuery('.wdx-shops-list-sidebar, .wdx-shops-list-toolbar').removeClass('active');
			}
		});

		jQuery('.wdx-shops-list-toolbar-btn').on('click', function() {
			var width, sidebar, toolbar, grid;
            
            width = jQuery(window).width();
            sidebar = jQuery('.wdx-shops-list-sidebar');
            toolbar = jQuery('.wdx-shops-list-toolbar');
            grid = jQuery('.wdx-shops-list-grid');

            sidebar.toggleClass('moved');
            toolbar.toggleClass('moved');
            grid.toggleClass('moved');

		});

		function listSetup() {
            var width, sidebar, toolbar, grid;
            
            width = jQuery(window).width();
            sidebar = jQuery('.wdx-shops-list-sidebar');
            toolbar = jQuery('.wdx-shops-list-toolbar');
            grid = jQuery('.wdx-shops-list-grid');

            if(width < 1350) {
                sidebar.addClass('moved');
                toolbar.addClass('moved');
                grid.addClass('moved');
            }
            else {
                sidebar.removeClass('moved');
                toolbar.removeClass('moved');
                grid.removeClass('moved');
            }
        }

        listSetup();

        jQuery(window).resize(function() {
        	listSetup();
        });
	}

	getUniqueFeatures(array, comparatorProperty) {
	    let existingFeatureKeys = {};
	    let uniqueFeatures = array.filter(function(el) {
	        if (existingFeatureKeys[el.properties[comparatorProperty]]) {
	            return false;
	        } else {
	            existingFeatureKeys[el.properties[comparatorProperty]] = true;
	            return true;
	        }
	    });
	    return uniqueFeatures;
	}

